import React from 'react';
import { Link } from "react-router-dom";
import MiddleCarts from '../components/MiddleCarts'
import styled from "styled-components";

const Styles = styled.div`
.middle-links {
  height: 100%;
  width: 100%;
}

.middle-links a {
  background-color: #fff;
  border: 1px solid #ff9a8d;
  color: #ff9a8d;
  font-weight: bold;
  border-radius: 8px;
  text-align: center;
}

.middle-links a:hover,
.middle-links a:focus,
.middle-links a:active {
  background-color: #a89999;
}
`;
export const Home = () => (
  <Styles>
    <MiddleCarts/>
    <div className="row">
      <div className="col-4 middle-links">
        <Link to="/" >Ayrıntılı bilgi için</Link>
      </div>
      <div className="col-4">

      </div>
      <div className="col-4">

      </div>
    </div>
  </Styles>
)
